【ナチュラルの着痩せポイント】﻿
﻿
﻿
[トップス]﻿
ナチュラルのトップス選びには﻿
シルエットが大事です。﻿
﻿
ざっくりな素材感が似合うと﻿
言われますが﻿
キレイめにしたいときには﻿
全身を細長い長方形の﻿
フレームになるようなシルエットに﻿
すると垢抜けます。﻿
﻿
﻿
[ボトムス]﻿
ナチュラルはウエストのくびれが﻿
なかなか出づらいかたが多いです。﻿
﻿
特に腰骨が横になりだすことが﻿
多いのすが﻿
﻿
キレイめにするときには﻿
きちんとベルトを締めてウエストマーク﻿
することで着痩せします。﻿
﻿
ベルトは太めがGOOD!﻿
﻿
﻿
[アクセサリー]﻿
ナチュラルの上品コーデの主役は﻿
パールのロングネックレス。﻿
